{
  "ubx_message": {
    "message_name": "UBX-CFG-NAVX5",
    "class_id": "0x06",
    "message_id": "0x23",
    "message_type": "get_set",
    "comment": "This message is deprecated in protocol versions greater than 23.01. Use UBX-CFG-VALSET, UBX-CFG-VALGET, UBX-CFG-VALDEL instead. See the Legacy UBX Message Fields Reference for the corresponding configuration item.",
    "payload_length": {
      "fixed": 40
    },
    "payload_fields": [
      {
        "byte_offset": 0,
        "name": "version",
        "data_type": "U2",
        "comment": "Message version (0x0002 for this version)"
      },
      {
        "byte_offset": 2,
        "name": "mask1",
        "data_type": "X2",
        "comment": "First parameters bitmask. Only the flagged parameters will be applied, unused bits must be set to 0.",
        "bits": [
          {
            "bit_offset": 2,
            "bit_length": 1,
            "name": "minMax",
            "comment": "1 = apply min/max SVs settings"
          },
          {
            "bit_offset": 3,
            "bit_length": 1,
            "name": "minCno",
            "comment": "1 = apply minimum C/NO setting"
          },
          {
            "bit_offset": 6,
            "bit_length": 1,
            "name": "initial3dfix",
            "comment": "1 = apply initial 3D fix settings"
          },
          {
            "bit_offset": 9,
            "bit_length": 1,
            "name": "wknRoll",
            "comment": "1 = apply GPS weeknumber rollover settings"
          },
          {
            "bit_offset": 10,
            "bit_length": 1,
            "name": "ackAid",
            "comment": "1 = apply assistance acknowledgement settings"
          },
          {
            "bit_offset": 13,
            "bit_length": 1,
            "name": "PPP",
            "comment": "1 = apply usePPP flag"
          },
          {
            "bit_offset": 14,
            "bit_length": 1,
            "name": "aop",
            "comment": "1 = apply aopCfg (useAOP flag) and aopOrbMaxErr settings (AssistNow Autonomous)"
          }
        ]
      },
      {
        "byte_offset": 4,
        "name": "mask2",
        "data_type": "X4",
        "comment": "Second parameters bitmask. Only the flagged parameters will be applied, unused bits must be set to 0.",
        "bits": [
          {
            "bit_offset": 6,
            "bit_length": 1,
            "name": "adr",
            "comment": "Apply ADR/UDR sensor fusion on/off setting (useAdr flag)"
          },
          {
            "bit_offset": 7,
            "bit_length": 1,
            "name": "sigAttenComp",
            "comment": "Only supported on certain products"
          }
        ]
      },
      {
        "byte_offset": 8,
        "name": "reserved0",
        "data_type": {
          "array_of": "U1",
          "count": 2
        },
        "comment": "Reserved",
        "reserved": true
      },
      {
        "byte_offset": 10,
        "name": "minSVs",
        "data_type": "U1",
        "unit": "#SVs",
        "comment": "Minimum number of satellites for navigation"
      },
      {
        "byte_offset": 11,
        "name": "maxSVs",
        "data_type": "U1",
        "unit": "#SVs",
        "comment": "Maximum number of satellites for navigation"
      },
      {
        "byte_offset": 12,
        "name": "minCNO",
        "data_type": "U1",
        "unit": "dBHz",
        "comment": "Minimum satellite signal level for navigation"
      },
      {
        "byte_offset": 13,
        "name": "reserved1",
        "data_type": "U1",
        "comment": "Reserved",
        "reserved": true
      },
      {
        "byte_offset": 14,
        "name": "iniFix3D",
        "data_type": "U1",
        "comment": "1 = initial fix must be 3D"
      },
      {
        "byte_offset": 15,
        "name": "reserved2",
        "data_type": {
          "array_of": "U1",
          "count": 2
        },
        "comment": "Reserved",
        "reserved": true
      },
      {
        "byte_offset": 17,
        "name": "ackAiding",
        "data_type": "U1",
        "comment": "1 = issue acknowledgements for assistance message input"
      },
      {
        "byte_offset": 18,
        "name": "wknRollover",
        "data_type": "U2",
        "comment": "GPS week rollover number; GPS week numbers will be set correctly from this week up to 1024 weeks after this week. Setting this to 0 reverts to firmware default."
      },
      {
        "byte_offset": 20,
        "name": "sigAttenCompMode",
        "data_type": "U1",
        "unit": "dBHz",
        "comment": "Only supported on certain products"
      },
      {
        "byte_offset": 21,
        "name": "reserved3",
        "data_type": "U1",
        "comment": "Reserved",
        "reserved": true
      },
      {
        "byte_offset": 22,
        "name": "reserved4",
        "data_type": {
          "array_of": "U1",
          "count": 2
        },
        "comment": "Reserved",
        "reserved": true
      },
      {
        "byte_offset": 24,
        "name": "reserved5",
        "data_type": {
          "array_of": "U1",
          "count": 2
        },
        "comment": "Reserved",
        "reserved": true
      },
      {
        "byte_offset": 26,
        "name": "usePPP",
        "data_type": "U1",
        "comment": "1 = use Precise Point Positioning (only available with the PPP product variant)"
      },
      {
        "byte_offset": 27,
        "name": "aopCfg",
        "data_type": "U1",
        "comment": "AssistNow Autonomous configuration",
        "bits": [
          {
            "bit_offset": 0,
            "bit_length": 1,
            "name": "useAOP",
            "comment": "1 = enable AssistNow Autonomous"
          }
        ]
      },
      {
        "byte_offset": 28,
        "name": "reserved6",
        "data_type": {
          "array_of": "U1",
          "count": 2
        },
        "comment": "Reserved",
        "reserved": true
      },
      {
        "byte_offset": 30,
        "name": "aopOrbMaxErr",
        "data_type": "U2",
        "unit": "m",
        "comment": "Maximum acceptable (modeled) AssistNow Autonomous orbit error (valid range = 5..1000, or 0 = reset to firmware default)"
      },
      {
        "byte_offset": 32,
        "name": "reserved7",
        "data_type": {
          "array_of": "U1",
          "count": 4
        },
        "comment": "Reserved",
        "reserved": true
      },
      {
        "byte_offset": 36,
        "name": "reserved8",
        "data_type": {
          "array_of": "U1",
          "count": 3
        },
        "comment": "Reserved",
        "reserved": true
      },
      {
        "byte_offset": 39,
        "name": "useAdr",
        "data_type": "U1",
        "comment": "Only supported on certain products"
      }
    ]
  }
}
